import { Link } from 'react-router-dom';
import "../styles/HomePage.css";

function HomePage() {
    return (
        <div>
            <a href="/" className="breadcrumbs">Главная</a>
            <h1 className="title">Ozon</h1>
            <a href='/products' className="link">Каталог</a>
        </div>
    );
}

export default HomePage;
